class Casa():
    def __init__(self, casa1, casa2, casa3, casa4, casa5):
        self.casa1 = casa1
        self.casa2 = casa2
        self.casa3 = casa3
        self.casa4 = casa4
        self.casa5 = casa5

    def posicion_1(self):
        window.update_idletasks()
        bg = PhotoImage(data=base64.b64decode(self.casa1))
        label = Label(window, image=bg)
        label.place(x = 50,y = 200)
        

        window.update_idletasks()
        bg = PhotoImage(data=base64.b64decode(self.casa2))
        label = Label(window, image=bg)
        label.place(x = 300,y = 200)
        

        window.update_idletasks()
        bg = PhotoImage(data=base64.b64decode(self.casa3))
        label = Label(window, image=bg)
        label.place(x = 100,y = 20)
        

        window.update_idletasks()
        bg = PhotoImage(data=base64.b64decode(self.casa4))
        label = Label(window, image=bg)
        label.place(x = 100,y = 600)
        

        window.update_idletasks()
        bg = PhotoImage(data=base64.b64decode(self.casa5))
        label = Label(window, image=bg)
        label.place(x = 60,y = 200)
        window.mainloop()

    
           

